import '../css/pageAdmi.css';

export const PageAdmi = () => {
  return (
    <div className="App">
      <div className="sidebar">
        <ul>
          <li><a href="/">Inicio</a></li>
          <li><a href="/">Usuarios</a></li>
          <li><a href="/">Productos</a></li>
        </ul>
      </div>
      <div className="content">
        <h1>Inicio</h1>
        <p>Esta es la p√°gina de inicio del dashboard.</p>
      </div>
      <Footer />
